"""
题目：https://leetcode-cn.com/problems/minimum-window-substring/

给你一个字符串 S、一个字符串 T，请在字符串 S 里面找出：包含 T 所有字符的最小子串。

示例：

输入: S = "ADOBECODEBANC", T = "ABC"
输出: "BANC"
说明：

如果 S 中不存这样的子串，则返回空字符串 ""。
如果 S 中存在这样的子串，我们保证它是唯一的答案。
"""

import time
from typing import List
from collections import Counter, defaultdict


class Solution1:
    """
    暴力破解法：
    从s的每个元素开始，作为起始位置，往后获取最短的数组，一直到所有的元素都包括位置，然后计算最短的字符串长度
    """
    def minWindow(self, s: str, t: str) -> str:
        if len(s) < len(t): return ''

        lenS = len(s)
        
        left, right = 0, lenS + 1
        for i in range(lenS):
            j = i
            tCounter = Counter(t)
            lenT = len(t)
            if not tCounter.get(s[j]): continue
            while j < lenS and lenT:
                if tCounter.get(s[j], 0) > 0:
                    tCounter[s[j]] -= 1
                    lenT -= 1
                j += 1
            if lenT == 0 and j - i < right - left:
                left, right = i, j
            if right - left == len(set(t)):
                break
        return s[left:right] if right != lenS + 1 else ""


class Solution2:
    """
    滑动窗口法 sliding window
    """
    def minWindow(self, s: str, t: str) -> str:
        if not s or not t or len(s) < len(t): return ''

        lenS, lenT = len(s), len(t)
        left, right = -1, -1
        distance = 0
        start, length = 0, lenS + 1
        tFreq = Counter(t)
        winFreq = defaultdict(int)

        while left <= right < lenS:
            # print(f'left: {left}; right: {right}; distance: {distance}; lenS: {lenS}')
            if distance == lenT:
                if right - left + 1 < length:
                    start = left
                    length = right - left + 1
                winFreq[s[left]] -= 1
                if winFreq[s[left]] < tFreq.get(s[left], 0):
                    distance -= 1
                left += 1
            else:
                if right == -1: left += 1
                right += 1
                if right == lenS: break
                winFreq[s[right]] += 1
                if winFreq[s[right]] <= tFreq.get(s[right], 0):
                    distance += 1
        return s[start:start + length] if length != lenS + 1 else ''


class Solution3:
    """
    滑动窗口 sliding window的规范写法，这里参考了 
    https://leetcode-cn.com/problems/minimum-window-substring/solution/hua-dong-chuang-kou-suan-fa-tong-yong-si-xiang-by-/
    滑动窗口的模板如下：
    def slidingWindow(source, target):
        need = collections.defaultdict(int)
        window = collections.defaultdict(int)
        needs = Counter(target)
        left = right = 0
        distance = 0

        # 左闭右开的方式 [left, right)
        while right < len(source):
            # c 是将要移进窗口window的字符
            c = source[right]
            right += 1
            # 进行窗口内一系列更新
            # ......

            # debug输出位置
            print(f'left: {left}, right: {right}, distance: {distance}')

            # 判断左边窗口是否需要收缩
            while (window needs shrink):
                # d 是将要移出窗口window的字符
                d = source[left]
                left += 1
                # 进行窗口内一系列更新
                # ......
    """
    def minWindow(self, s: str, t: str) -> str:
        window = defaultdict(int)
        need = Counter(t)
        left = right = 0
        distance = 0
        lenS = len(s)
        start, length = 0, lenS + 1

        while right < lenS:
            c = s[right]
            right += 1
            window[c] += 1
            if need[c] == window[c]:
                distance += 1
            
            print(f'left: {left}; right: {right}; distance: {distance}')
            while distance == len(need):
                d = s[left]
                left += 1
                window[d] -= 1
                if need[d] > window[d]:
                    distance -= 1
                    if right - left + 1 < length:
                        start = left - 1
                        length = right - left + 1
        return s[start:start + length] if length != lenS + 1 else ''


if __name__ == "__main__":
    test = [
        ["ADOBECODEBANC", "ABC"],  # "BANC"
        ["a", "aa"], # ""
        ["a", "b"], # ""
        # ["", ""]
    ]
    start = time.perf_counter()
    for (S, T) in test:
        result = Solution3().minWindow(S, T)
        print(f'{S} {T} minWindow => "{result}"')
    end = time.perf_counter()
